import React from 'react';
import './App.css';
import { Provider } from 'react-redux';
import store from './redux/store';
import Home from './pages/home';
import NameForm from './pages/NameForm';

function App() {
  return (
    <div className="App">
      <Provider store={store}>
        <div style={{ padding: 15 }}>
          <h2>Simple Form</h2>
        </div>
      </Provider>
    </div>
  );
}

export default App;
